import React, { Component } from 'react';
import logo from '../logo.svg';
import '../App.css';

import {BrowserRouter as Router, Route, Link, NavLink} from 'react-router-dom';

const News = ({match}) => {
  return (
<h1>News Page</h1> 
    )
}

const Profile = () => {
  return (
<h1>Profile Page: Selin Ã–ser</h1> 
    )
}

class App extends Component {

  state = {
    loggedIn :false
  }

  OnClickButton= () => {
     this.setState(prevState => ({

      loggedIn: !prevState.loggedIn
     }))
  }

  render() {
    return (


   <Router>
   <div>
    <NavLink activeStyle={{color:'red'}} exact to="/">Homepage</NavLink><br/>
    <NavLink activeStyle={{color:'red'}} exact to="/contact">Contact</NavLink><br/>
    <NavLink activeStyle={{color:'red'}} exact to="/news">News</NavLink><br/>
    <NavLink activeStyle={{color:'red'}} exact to="/profile">Profile</NavLink>

    <br/><br/>

    <input type="button" onClick= {this.OnClickButton} value={"Log in"} />

   <Route path="/"  exact render= {() => { return(<h1>Homepage</h1>)}}>
   </Route>
   <Route path="/contact"  exact render= {() => { return(<h1>Contact</h1>)}}>
   </Route>

   <Route path="/news"  exact component= {News}>
   </Route>

   <Route path="/profile"  exact component= {Profile}>
   </Route>

   </div>
   </Router>
    );
  }
}

export default App;
